INSERT INTO public.dreapp_documenttext VALUES (478663, 1374085, '2015-09-01 21:15:25.582097+01', 'https://dre.pt/home/-/dre/2371118/details/maximized?serie=II&parte_filter=32', '

<div><p>Despacho (extracto) n.º 1868/2009</p><p>Por despacho de 08.10.2008, do Reitor da Universidade do Minho:</p><p>Doutor José João Antunes Guimarães Dias de Almeida - Professor Auxiliar em contrato administrativo de provimento, na Universidade do Minho, nomeada definitivamente na mesma categoria com efeitos a partir de 05.12.2008. (Isento de Fiscalização Prévia do TC).</p><p>Relatório a que se refere o n.º 2 do artigo 25.º do Estatuto da Carreira Docente Universitária anexo à Lei n.º 19/80, de 16 de Julho</p><p>O conselho científico da Escola de Engenharia, reunido em 1 de Outubro de 2008, apreciou o parecer circunstanciado e fundamentado elaborado pelos Professores Catedráticos Miguel Caetano de Oliveira Filgueiras, em exercício de funções na Faculdade de Ciências da Universidade do Porto e José Manuel Esgalhado Valença e Alberto José Gonçalves de Carvalho Proença em exercício efectivo de funções na Escola de Engenharia da Universidade do Minho, considerou que a actividade científica e pedagógica desenvolvida pelo Doutor José João Antunes Guimarães Dias de Almeida satisfaz os requisitos os artigo 20.º e 25.º de E.C.D.U. pelo que deliberou, por unanimidade, propor a sua nomeação definitiva como professor Auxiliar desta Universidade.</p><p>1 de Outubro de 2008. - O Presidente do Conselho Científico da Escola de Engenharia, António M. Cunha.</p><p>5 de Janeiro de 2009. - O Director de Serviços, Luís Carlos Ferreira Fernandes.</p></div>
');
