INSERT INTO public.dreapp_documenttext VALUES (1475423, 3548162, '2018-12-10 09:38:38.671368+00', 'https://dre.pt/home/-/dre/117279759/details/maximized?serie=II&parte_filter=32', '

<div><p>Aviso n.º 18267/2018</p><p>No âmbito dos poderes que me foram conferidos pelo Despacho (extrato) n.º 5073/2018, de 22 de maio, do Presidente do Conselho Diretivo deste Instituto, e em cumprimento do disposto na alínea d), do n.º 1, do artigo 4.º da Lei n.º 35/2014, de 20 de junho, publicada no Diário da República, 2.ª série, n.º 101, de 25 de maio de 2016, torna-se público que, por deliberação do Conselho Diretivo do Instituto de Gestão Financeira e Equipamentos da Justiça, I. P., tomada em sua reunião de 24 de agosto de 2018, foram deferidos os pedidos de cessação das comissões de serviço que vinham exercendo neste Organismo aos oficiais de justiça, abaixo identificados, com efeitos a partir de 16 de setembro de 2018, regressando os oficiais de justiça em causa ao seu serviço de origem.</p><p>José Carlos Dias Carneiro;</p><p>Isabel Maria Gomes Almeida;</p><p>João Paulo da Cunha Mascarenhas Leite;</p><p>António José Marques Almeida Barbosa.</p><p>23 de novembro de 2018. - A Diretora do Departamento de Administração Geral, Sandra Esteves.</p><p>311850951</p></div>
');
